import React from 'react';
import { Button } from 'antd';
import 'antd/dist/antd.css';

const Toolbar = () => {
    return (
        <div className='toolbar'>
            <Button type="primary" ghost>
                Block
            </Button>
            <Button type="primary" ghost>
                Unblock
            </Button>
            <Button type="primary" danger ghost>
                Delete
            </Button>
        </div>
    );
};

export default Toolbar;
